ed);\n	var arrTables = checked.split(\",\");\n\n	var colIndex = mygridG2.getColIndexById(\"RESULT\");\n\n	for(t=0;t<arrTables.length;t++){\n		var tableNm = arrTables[t];\n\n		//alert(tableNm);\n		//alert(\"rowid, 컬럼순번:\" + tableNm + \", \" + colIndex);\n		//불러오기\n		$.ajax({\n			type : \"GET\",\n			url : CFG_CGWEB_URL + \"/c.g/cg_cdeploy_db.php?CTL=LOADFROMGITHUB&TOKEN=\" + token + \"&TARGET_DB=\" + $(\"#G1-TARGET_DB\").val()  + \"&DB=\" + $(\"#G1-DB\").val() + \"&TABLE=\" + tableNm ,\n			dataType: \"jsonp\",\n			privateTableNm : tableNm,\n			async: false,\n			success: function(data){\n				alog(\"   gridG2 json return----------------------\");\n\n				//alog(\"   json RTN_MSG length : \" + data.RTN_MSG.length);\n				if(data.RTN_CD ==\"200\"){\n					mygridG2.cells(this.privateTableNm,colIndex).setValue(\"O\");\n				}else{\n					msgError(data.RTN_MSG + \"(\" + data.ERR_CD + \")\",3);\n				}\n\n				//alert(\"응답오케이:\" + tableNm + \", \" + colIndex);\n\n			},\n			error: function(error){\n				msgError(\"[테이블목록] Ajax http 500 error ( \" + error + \" )\",3);\n				//alog(\"[테이블목록] Ajax http 500 error ( \" + data.RTN_MSG + \" )\");\n			}\n		});\n	}\n}\'\n		,MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\n  	where PJTSEQ = 3 and PGMSEQ = 103 and GRPSEQ = 259 and FNCSEQ = 1312\n		','PGMINFO','20200218060213'),(1580,'/m.k/cg_make.php','j0a0af1p9kp77319mrjbjti872',NULL,'5e4aff56798b1','zero12a',1,'log_CG','INFO','2','to_coltype before : i','CG_MAKE','20200218060214'),(1581,'/m.k/cg_make.php','j0a0af1p9kp77319mrjbjti872',NULL,'5e4aff56798b1','zero12a',1,'log_CG','INFO','2','to_coltype after : i','CG_MAKE','20200218060214'),(1582,'/m.k/cg_make.php','j0a0af1p9kp77319mrjbjti872',NULL,'5e4aff56798b1','zero12a',1,'log_CG','INFO','2','prepare sql : select * from CG_PJTINFO where PJTSEQ = ?','CG_MAKE','20200218060214'),(1583,'/m.k/cg_make.php','j0a0af1p9kp77319mrjbjti872',NULL,'5e4aff56798b1','zero12a',1,'log_CG','INFO','2','full sql : select * from CG_PJTINFO where PJTSEQ = 3','CG_MAKE',