, SQLTXT = \'select LOGSEQ, URL, SESSIONID, REQTOKEN, RESTOKEN, USERID, USERSEQ, LISTNM, LOGLEVEL, LOGDT, LOGMSG, CHANNEL, ADDDT\nfrom CG_MONOLOG\nwhere ADDDT >= concat(replace(#{G1-ADDDT},\\\'.\\\',\\\'\\\'),\\\'000000\\\')\n	and ADDDT <= concat(replace(#{G1-ADDDT},\\\'.\\\',\\\'\\\'),\\\'235959\\\')\n	and\n	case when length(#{G1-LISTNM}) > 0 \n		then LISTNM like concat(\\\'%\\\',#{G1-LISTNM},\\\'%\\\')\n		else 1=1\n	end and\n	case when length(#{G1-LOGLEVEL}) > 0 \n		then LOGLEVEL like concat(\\\'%\\\',#{G1-LOGLEVEL},\\\'%\\\')\n		else 1=1\n	end and\n	case when length(#{G1-LOGMSG}) > 0 \n		then LOGMSG like concat(\\\'%\\\',#{G1-LOGMSG},\\\'%\\\')\n		else 1=1\n	end and\n	case when length(#{G1-CHANNEL}) > 0 \n		then CHANNEL like concat(\\\'%\\\',#{G1-CHANNEL},\\\'%\\\')\n		else 1=1\n	end\norder by LOGSEQ desc\n\', SQLORD = 1, PSQLSEQ = ifnull(null,0)\n			, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\n		where PJTSEQ = 3  and PGMSEQ = 100 and SQLSEQ = 392 \n		','PGMINFO','20200227071805'),(16556,'/c.g/cg_pgminfo_crud3.php','ab3v48m4j28emf2c61rl8d0bbg','','5e56ee9c344da','zero12a',1,'log_CG','INFO','2','to_coltype before : iii','PGMINFO','20200227071805'),(16557,'/c.g/cg_pgminfo_crud3.php','ab3v48m4j28emf2c61rl8d0bbg','','5e56ee9c344da','zero12a',1,'log_CG','INFO','2','to_coltype after : iii','PGMINFO','20200227071805'),(16558,'/c.g/cg_pgminfo_crud3.php','ab3v48m4j28emf2c61rl8d0bbg','','5e56ee9c344da','zero12a',1,'log_CG','INFO','2','prepare sql :  \n			select COLSEQ, COLID, REQUIREYN, ORD, ADDDT \n			from CG_PGMSQLD \n			where  PJTSEQ = ? and PGMSEQ = ? and SQLSEQ = ? and SQLGBN = \'O\'\n			order by ORD asc ','PGMINFO','20200227071805'),(16559,'/c.g/cg_pgminfo_crud3.php','ab3v48m4j28emf2c61rl8d0bbg','','5e56ee9c344da','zero12a',1,'log_CG','INFO','2','full sql :  \n			select COLSEQ, COLID, REQUIREYN, ORD, ADDDT \n			from CG_PGMSQLD \n			where  PJTSEQ = 3 and PGMSEQ = 100 and SQLSEQ = 392 and SQLGBN = \'O\'\n			order by ORD asc ','PGMINFO','20200227071805'),(16560,'/